import { observer } from 'mobx-react-lite'
import React from 'react'
import { productStore } from '../../../stores/ProductStore'

export const TypeBar = observer(() => {
    const { categories } = productStore;

    return (
        <aside>
            <ul>
                {categories.map(category => <li>`${category}`</li>)}
            </ul>
        </aside>
    )
})
